        <input className="otp-field" type="text" name="otp" maxLength="1" />
        <p className="aut1">Resend code</p>
        
       <Button></Button>
        

        <Card.Img className="imgdown" src={Down} />
      </div>
    );
}
 
export default PasswordComponenet;
